import React from 'react';
import './App.css';

function App() {

  const subreddit = "memes"
  const heads = new Headers();
  const url = `https://www.reddit.com/r/${subreddit}/top.json?limit=10`;
  const url1 = `https://www.reddit.com/api/v1/authorize?client_id=BmIWdmE0hYrM7Q&response_type=code&state=alskdjfhg&redirect_uri=http://localhost:3000&duration=permanent&scope=identity`;
  const url2 = `https://www.reddit.com/api/search_reddit_names?exact=false&include_over_18=true&include_unadvertisable=true&query=Tech`;
  const xhr = new XMLHttpRequest();

  // xhr.open('GET', url1);
  // xhr.setRequestHeader('Access-Control-Allow-Headers', 'true');
  // xhr.setRequestHeader('Access-Control-Allow-Origin', 'http://localhost:3000');
  // xhr.setRequestHeader('Content-Type', 'application/xml');


  heads.append("Access-Control-Allow-Methods", "GET,HEAD,OPTIONS,POST,PUT");
  heads.append("Access-Control-Allow-Headers", "Accept");
  heads.append('Access-Control-Allow-Origin', '*');

  window.fetch(url1, {
    headers: heads,
    method: 'POST',
    mode: 'cors',
    redirect: 'follow',
  })
  .then((res) => {
    res.setHeader("Access-Control-Allow-Origin", "*");
    res.setHeader("Access-Control-Allow-Credentials", "true");
    res.setHeader("Access-Control-Allow-Methods", "GET,HEAD,OPTIONS,POST,PUT");
    res.setHeader("Access-Control-Allow-Headers", "*");
    console.log(res);
  })
  .catch((error) => {
    console.log('Error: ' + error);
  });


  return (
    <div className="App">
      <p>{url1}</p>
    </div>
  );
}

export default App;
